import React from 'react';
import './Home.css';
import Header from '../components/Header';
import Menu from '../components/Menu';
import Card from '../components/Card';

//import axios from 'axios';
import { createStore, combineReducers } from 'redux';
import { Provider, connect } from 'react-redux';

const GET_WEATHER_REQUEST = 'GET_WEATHER_REQUEST';
const GET_WEATHER_SUCCESS = 'GET_WEATHER_SUCCESS';
const GET_WEATHER_FAILURE = 'GET_WEATHER_FAILURE';

const weatherReducer = (state: any = {}, action: any) => {
    switch (action.type) {
      case GET_WEATHER_REQUEST:
        return {
          ...state,
          loading: true,
          error: null,
        };
      case GET_WEATHER_SUCCESS:
        return {
          ...state,
          weather: action.weather,
          loading: false,
          error: null,
        };
      case GET_WEATHER_FAILURE:
        return {
          ...state,
          loading: false,
          error: action.error,
        };
      default:
        return state;
    }
  };
  
  // Crear el store de Redux con el reducer
  const store = createStore(weatherReducer);

function Home() {
    return (

        <div >

            <Header></Header>

            <div className='body'>

                <Menu/>

                <div className='cards-container'>
                    <Card/>
                    <Card/>
                    <Card/>
                    <Card/>
                </div>

            </div>

        </div>
    );
}

export default Home;
